INSERT INTO `sb_faq_locals` (`id`, `faq_id`, `lang_code`, `local_title`, `local_description`) VALUES
(5, 1, 'EN', 'How can I order a gift card?', '<p>No matter on what occasion, whether as a birthday present, at Christmas, or as a small gift for friends or family. With a gift card from EAT.ch you can treat your favourite foodie to their favourite treat. You can easily order the gift card online and print it out at home. Please find the link here: https://www.eat.ch/page/giftcard</p>'),
(6, 1, 'DE', 'How can I order a gift card?', '<p>No matter on what occasion, whether as a birthday present, at Christmas, or as a small gift for friends or family. With a gift card from EAT.ch you can treat your favourite foodie to their favourite treat. You can easily order the gift card online and print it out at home. Please find the link here: https://www.eat.ch/page/giftcard</p>'),
(7, 2, 'EN', 'I received something different than what I ordered', '<p>Please contact us immediately on 0848 74 99 21.</p>'),
(8, 2, 'DE', 'I received something different than what I ordered', '<p>Please contact us immediately on 0848 74 99 21.</p>'),
(9, 3, 'EN', 'My order has been canceled. How can I get my money back?', '<p>Payments already made will be automatically refunded within 5-6 working days in the event of a cancellation.</p>'),
(10, 3, 'DE', 'My order has been canceled. How can I get my money back?', '<p>Payments already made will be automatically refunded within 5-6 working days in the event of a cancellation.</p>'),
(11, 4, 'EN', 'Can I change the payment method later?', '<p>Yes, just call us on: 0848 74 99 21. Our support team will be happy to help you</p>'),
(12, 4, 'DE', 'Can I change the payment method later?', '<p>Yes, just call us on: 0848 74 99 21. Our support team will be happy to help you</p>'),
(13, 5, 'EN', 'My voucher does not work', '<p>Vouchers are not cumulative. Only one voucher can be redeemed per order.</p>'),
(14, 5, 'DE', 'My voucher does not work', '<p>Vouchers are not cumulative. Only one voucher can be redeemed per order.</p>'),
(15, 6, 'EN', 'How can I redeem/activate/ use a voucher?', '<p>Fill your shopping cart as usual. Then click on &quot;Order&quot;. When choosing a payment method, click on the desired option.</p>'),
(16, 6, 'DE', 'How can I redeem/activate/ use a voucher?', '<p>Fill your shopping cart as usual. Then click on &quot;Order&quot;. When choosing a payment method, click on the desired option.</p>'),
(17, 7, 'EN', 'How can I change / delete my rating?', '<p>It is not possible to change your rating.</p>'),
(18, 7, 'DE', 'How can I change / delete my rating?', '<p>It is not possible to change your rating.</p>'),
(19, 8, 'EN', 'How can I submit a review?', '<p>About one hour after receiving the order, we will send you an e-mail in which you will find a relevant link for submitting a rating.</p>\r\n\r\n<p>Alternatively you can proceed as follows: Log on to the computer on eat.ch. Then click on the upper right on your now appearing name. There you can submit a rating under &quot;Orders &amp; Ratings&quot;.</p>'),
(20, 8, 'DE', 'How can I submit a review?', '<p>About one hour after receiving the order, we will send you an e-mail in which you will find a relevant link for submitting a rating.</p>\r\n\r\n<p>Alternatively you can proceed as follows: Log on to the computer on eat.ch. Then click on the upper right on your now appearing name. There you can submit a rating under &quot;Orders &amp; Ratings&quot;.</p>'),
(21, 9, 'EN', 'I have not received a confirmation SMS', '<p>You only receive a confirmation SMS y at certain restaurants, not all. If you have received an order confirmation by e-mail, the order has been sent in each case successfully.</p>'),
(22, 9, 'DE', 'I have not received a confirmation SMS', '<p>You only receive a confirmation SMS y at certain restaurants, not all. If you have received an order confirmation by e-mail, the order has been sent in each case successfully.</p>'),
(23, 10, 'EN', 'I did not receive an order confirmation by e-mail', '<p>Did the order confirmation accidentally end up in the spam/junk folder? If not you should contact us: 0848 74 99 21</p>'),
(24, 10, 'DE', 'I did not receive an order confirmation by e-mail', '<p>Did the order confirmation accidentally end up in the spam/junk folder? If not you should contact us: 0848 74 99 21</p>'),
(25, 11, 'EN', 'I forgot my password', '<p>No problem. Click on &quot;Sign in&quot; in the top right corner. Then click on the button &quot;Forgot your password?&quot;. Now enter your e-mail address and confirm the entry by clicking on &quot;Reset password&quot;. We will send you an e-mail with a link to reset the password.</p>'),
(26, 11, 'DE', 'I forgot my password', '<p>No problem. Click on &quot;Sign in&quot; in the top right corner. Then click on the button &quot;Forgot your password?&quot;. Now enter your e-mail address and confirm the entry by clicking on &quot;Reset password&quot;. We will send you an e-mail with a link to reset the password.</p>'),
(27, 12, 'EN', 'Where can I change my address information?', '<p>There are two possibilities: Log in to eat.ch on the computer. Then click on the upper right on your now apparent name. Now you can update your address information under &quot;delivery address&quot;.</p>\r\n\r\n<p>Alternatively, you can also edit this information shortly before the order is submitted. Fill your shopping cart, click on &quot;Order&quot; and then change your address information under &quot;Delivery Details&quot;. You can also edit this information in the order overview (one step further).</p>'),
(28, 12, 'DE', 'Where can I change my address information?', '<p>There are two possibilities: Log in to eat.ch on the computer. Then click on the upper right on your now apparent name. Now you can update your address information under &quot;delivery address&quot;.</p>\r\n\r\n<p>Alternatively, you can also edit this information shortly before the order is submitted. Fill your shopping cart, click on &quot;Order&quot; and then change your address information under &quot;Delivery Details&quot;. You can also edit this information in the order overview (one step further).</p>');
