INSERT INTO `sb_help_locals` (`id`, `help_id`, `lang_code`, `local_title`, `local_description`) VALUES
(9, 1, 'EN', 'Can I order over the phone?', '<p>No. And yes.</p>\r\n\r\n<p>Well, this depends on what you mean by ordering over the phone. If you using an online food delivery app then yes, you can indeed order by phone. We&rsquo;ve got the best food delivery apps for iPhone and Android.</p>\r\n\r\n<p>On the other hand if you intend to take a call and have your food ordered over the phone, then I&rsquo;m afraid we won&rsquo;t be able to provide.Firstly, I&#39;ll admit I&#39;m not quite sure why you would ever want to order over the phone. I mean, apart from having to repeat your order 10 times and stumbling over the weird food names and having zero time to think because the phone operator is rushing you, ordering off the phone will actually require you to do some human interaction.</p>\r\n\r\n<p>So, definitely nope. Instead, just use our website. We provide you with the best restaurants to order online where ever you are in Switzerland. Plus, you can&rsquo;t use our special online discounts and vouchers when you order over the phone!</p>'),
